/* Generated File Run.js in Project zaky */	function close_zaky(){	Minimizer.close("zaky");}	function minimize_zaky(){	Minimizer.minimize("zaky");}	function maximize_zaky(){	Minimizer.maximize("zaky");}function open_zaky(){}/* Initialize application */			function init_zaky(){	$("#body-zaky").keypress(function(event) {	}).mouseover(function(){	    $("#zaky-container").draggable({disabled:true});    }).mouseout(function(){        $("#zaky-container").draggable({disabled:false});    });		$("#zaky-container").mousedown(function(){		Focus.set("zaky");		setMenu_zaky();			fixSizezakySpeed = 0;	})	.mouseup(function(){		fixSizezakySpeed = 300;	});		/* Make application resizable */	Resizable.set("zaky");		$("#exit-zaky").mousedown(function(){		close_zaky();		$("#body-zaky").val("");	});	$("#maximize-zaky").mousedown(function(){		maximize_zaky()	});		$("#minimize-zaky").mousedown(function(){		minimize_zaky()	});			fixSize_zaky();    main_zaky();}function main_zaky(){    $("#zaky-button1").click(function(){        MessageBox.show('Zaky',$("#zaky-textbox1").html());    });    $("#zaky-button2").click(function(){        $("#zaky-textbox1").html('');    });}/* Fix size application */var fixSizezakySpeed = 300;function fixSize_zaky(){	setTimeout(function(){		if(LoadAppsID["zaky"].onFocus){			height = $("#zaky-container").height();			width = $("#zaky-container").width();			$("#body-zaky").css({"height" : height-45, "width" : width-5});		}		fixSize_zaky();	},fixSizezakySpeed);}/* Set application menu */function setMenu_zaky(){	proIdApps = "zaky";	var valMenu = "<span id=top-menu-item0 class=top-menu-item>zaky</span>"+        "<ul id=top-menu-item0-down class=top-menu-item-down>"+            "<li onclick=minimize_zaky(proIdApps)>Minimize</li>"+			"<li onclick=maximize_zaky(proIdApps)>Maximize</li>"+			"<li onclick=close_zaky(proIdApps)>Quit zaky</li>"+        "</ul>";		$("#top-menu").html(valMenu);		Menu.fixedTopMenu();}/* Register application */function register_zaky(){	$.post("system/applications/zaky/layout/zaky.html", function(data){		ApplicationRun[applicationOpened] = data;		ApplicationRun[applicationOpened] = ApplicationRun[applicationOpened];		$(".program").html(($(".program").html())+ApplicationRun[applicationOpened]);		setTimeout(init_zaky,100);		fixSize_zaky();		applicationOpened++;	});	}/* Running application */function run_zaky(dir, fileName){}